import React, { Component } from "react";
import { motion } from "framer-motion";
import { Link, Router } from "react-router-dom";

const middle = {
  rest: { width: 0 },
  tap: {
    width: 28,
    transition: {
      duration: 1,
    },
  },
};

const topbottom = {};

class HamburgerNav extends Component {
  state = {};
  render() {
    return (
      <motion.a
        href="#"
        style={{
          textDecoration: "none",
          position: "relative",
        }}
        initial="rest"
        whileHover="tap"
        animate="rest"
      >
        <div style={{ height: 4, width: 28, backgroundColor: "black" }}></div>
        <motion.div
          style={{
            height: 4,
            backgroundColor: "black",
            position: "relative",
            top: 10,
          }}
          variants={middle}
        ></motion.div>
        <div
          style={{
            height: 4,
            width: 28,
            backgroundColor: "black",
            position: "relative",
            bottom: 1,
          }}
        ></div>
      </motion.a>
    );
  }
}

export default HamburgerNav;
